import './propertyCard.css'

function ProperytCard({ detail }) {
  console.log("detail===>>>", detail)
  return (
    <div className="propertyComp">
  <svg xmlns="http://www.w3.org/2000/svg" height="24" viewBox="0 0 24 24" width="24" className='heart'><path d="M0 0h24v24H0z" fill="none"/><path fill="#ffffff" d="M16.5 3c-1.74 0-3.41.81-4.5 2.09C10.91 3.81 9.24 3 7.5 3 4.42 3 2 5.42 2 8.5c0 3.78 3.4 6.86 8.55 11.54L12 21.35l1.45-1.32C18.6 15.36 22 12.28 22 8.5 22 5.42 19.58 3 16.5 3zm-4.4 15.55l-.1.1-.1-.1C7.14 14.24 4 11.39 4 8.5 4 6.5 5.5 5 7.5 5c1.54 0 3.04.99 3.57 2.36h1.87C13.46 5.99 14.96 5 16.5 5c2 0 3.5 1.5 3.5 3.5 0 2.89-3.14 5.74-7.9 10.05z"/></svg>
      {/* <img className='heart' src='http://www.w3.org/2000/svg' /> */}
      <img className="propertyImg" src={detail?.photos[0]} alt="" />
      <div className="propertyText">
        <h5>{detail?.property?.bedrooms} BR | {detail?.property?.bathsFull}{detail?.property?.bathsHalf} Bath | {detail?.property?.area} Sq Ft</h5>
        <h3>${detail?.listPrice}</h3>
        <h6>{detail?.address?.streetNumber} {detail?.address?.streetName}, {detail?.address?.city}</h6>
        <span className="listed">
          Listed: {detail?.listDate?.split("T")[0].split("-")[2]}/{detail?.listDate?.split("T")[0].split("-")[1]}/{detail?.listDate?.split("T")[0].split("-")[0].slice(2)}
        </span>
      </div>
    </div>
  )
}

export default ProperytCard;
